from flask import Flask, request, jsonify, make_response
import config
import mysql.connector

def loadPost(id):
    cnx = mysql.connector.connect(user=config.USERNAME, password=config.PASSWORD,host=config.DBHOST,database=config.DATABASE)
    # adding posts this way is a heck of a lot more convenient
    cursor = cnx.cursor(buffered=True)
    cursor.execute("SELECT * FROM posts WHERE postID = %s", (id,))
    row = cursor.fetchone()

    response = {
        "title": row[2],
        "date": row[4],
        "text": row[5],
        "author": {
            "username": "bag.xml",
            "userID": 1,
            "avatarPFP": 'data:image/jpeg;base64,'
        }
    }
    cursor.close()
    cnx.close()
    return jsonify(response)